import React from 'react'
import DarkModeSwitch from './DarkModeSwitch';

function Navbar() {

  return (
    <div className='navbar'>
      <div className="calc-heading"><h1>CALCULATOR</h1></div>
      <div className="darkModeSwitch">
        <DarkModeSwitch />
      </div>
    </div>
  )
}

export default Navbar;
